import React from 'react'
import { ProductsContainer } from '../../styles';
import Sidebar from '../fixedComponents/sidebar';
import ProductList from './ProductList';

function Product() {
    return(
        <ProductsContainer>
        <Sidebar />
            <p>Product</p>
            <ProductList />
        </ProductsContainer>
    )
}

export default Product
